import React, { useState, useEffect } from 'react';
import './index.css';

function SimpleApp() {
  const [isRecording, setIsRecording] = useState(false);
  const [transcript, setTranscript] = useState('');
  const [messages, setMessages] = useState([
    { sender: 'System', text: 'Welcome to the Voice Agent demo. Click "Start Recording" to begin.' }
  ]);
  const [audioStream, setAudioStream] = useState(null);
  const [mediaRecorder, setMediaRecorder] = useState(null);
  const [audioChunks, setAudioChunks] = useState([]);

  const startRecording = async () => {
    try {
      const stream = await navigator.mediaDevices.getUserMedia({ audio: true });
      setAudioStream(stream);

      const recorder = new MediaRecorder(stream);
      setMediaRecorder(recorder);

      const chunks = [];
      setAudioChunks(chunks);

      recorder.ondataavailable = (e) => {
        chunks.push(e.data);
      };

      recorder.onstop = async () => {
        const audioBlob = new Blob(chunks, { type: 'audio/wav' });
        await processAudio(audioBlob);
      };

      recorder.start();
      setIsRecording(true);

      addMessage('System', 'Recording started. Speak now...');
    } catch (err) {
      console.error('Error starting recording:', err);
      addMessage('System', `Error starting recording: ${err.message}`);
    }
  };

  const stopRecording = () => {
    if (mediaRecorder && isRecording) {
      mediaRecorder.stop();
      setIsRecording(false);

      // Stop all audio tracks
      if (audioStream) {
        audioStream.getTracks().forEach(track => track.stop());
      }

      addMessage('System', 'Recording stopped. Processing audio...');
    }
  };

  const processAudio = async (audioBlob) => {
    try {
      addMessage('System', 'Processing audio...');

      // Create a FormData object to send the audio file
      const formData = new FormData();
      formData.append('audio', audioBlob);

      // Send the audio to the backend for processing
      const response = await fetch('http://localhost:5000/api/process-audio', {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.error || 'Failed to process audio');
      }

      const data = await response.json();

      // Add user message with transcribed text
      addMessage('User', data.user_text);

      // Add agent response
      addMessage('Agent', data.response_text);

      // Play the audio response
      if (data.audio_path) {
        const audioUrl = `http://localhost:5000${data.audio_path}`;
        playAudioFromUrl(audioUrl);
      }

    } catch (err) {
      console.error('Error processing audio:', err);
      addMessage('System', `Error processing audio: ${err.message}`);
    }
  };

  const playResponseSound = () => {
    // In a real implementation, this would play the TTS audio from the agent
    const audioContext = new (window.AudioContext || window.webkitAudioContext)();
    const oscillator = audioContext.createOscillator();
    const gainNode = audioContext.createGain();

    oscillator.type = 'sine';
    oscillator.frequency.setValueAtTime(440, audioContext.currentTime); // A4 note

    gainNode.gain.setValueAtTime(0.1, audioContext.currentTime);
    gainNode.gain.exponentialRampToValueAtTime(0.001, audioContext.currentTime + 1);

    oscillator.connect(gainNode);
    gainNode.connect(audioContext.destination);

    oscillator.start();
    oscillator.stop(audioContext.currentTime + 1);
  };

  const addMessage = (sender, text) => {
    setMessages(prev => [...prev, { sender, text, timestamp: new Date() }]);
  };

  return (
    <div className="container">
      <div className="header">
        <h1 className="title">Voice Agent Demo</h1>
        <h2 className="subtitle">Talk with an AI voice assistant</h2>
      </div>

      <div className="card">
        <div className="controls">
          {!isRecording ? (
            <button 
              className="button" 
              onClick={startRecording}
            >
              Start Recording
            </button>
          ) : (
            <button 
              className="button" 
              onClick={stopRecording}
            >
              Stop Recording
            </button>
          )}
        </div>

        <div className={`status ${isRecording ? 'connected' : 'disconnected'}`}>
          Status: {isRecording ? 'Recording' : 'Not Recording'}
        </div>
      </div>

      <div className="card">
        <h3>Conversation</h3>
        <div className="transcript">
          {messages.map((msg, idx) => (
            <div 
              key={idx} 
              className={`message ${msg.sender.toLowerCase() === 'user' ? 'user' : 
                           msg.sender.toLowerCase() === 'agent' ? 'agent' : ''}`}
            >
              <div className="message-sender">{msg.sender}</div>
              <p className="message-text">{msg.text}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default SimpleApp;
